@zuhasohail18 I basically patched at the time the library to change the manifest manually.

But later on I followed what was suggested to create a provider in my app to centralize the providers to all use same structure.

So I made a new class in the android to handle all different providers to use airship as main provider for the notications.

Quick example:
```
public class CustomFcmService extends ReactNativeFirebaseMessagingService {
  @Override
  public void onMessageReceived(@NonNull RemoteMessage message) {
    Future<Void> future = AirshipFirebaseIntegration.processMessage(getApplicationContext(), message);
    super.onMessageReceived(message);
    try {
      future.get();
    } catch (Exception e) {
      Log.e("CustomFcmService", "Failed to wait for service", e);
    }
  }

  @Override
  public void onNewToken(@NonNull String token) {
    AirshipFirebaseIntegration.processNewToken(getApplicationContext(), token);
    super.onNewToken(token);
  }
}
```
